function onPageLoad(){$(".dropdown-toggle").dropdown(),$(".gallery").magnificPopup({delegate:"a",type:"image",gallery:{enabled:!0,navigateByImgClick:!1},callbacks:{imageLoadComplete:setupSwipe}})}function setupSwipe(){$(".mfp-img").mousedown(function(n){n.preventDefault()}),$(".mfp-img").swipe({swipeLeft:function(){$.magnificPopup.instance.next()},swipeRight:function(){$.magnificPopup.instance.prev()},tap:function(){$.magnificPopup.instance.next()},doubleTap:function(){window.open($.magnificPopup.instance.currItem.src,"_blank")}})}$(onPageLoad);